import "./style.css"
import Banner from "../../compoments/Banner"
import { useEffect, useState } from "react"

export default function Home() {
    const [items, setItems] = useState([])

    useEffect(() => {
        fetch("/logements.json")
        .then((e) => e.json())
        .then((data) => {
            setItems(data)
        })
    }, [])

    return (
        <>
        <div className="Home">
            <Banner />
            <div className="articlesbloc">
            {items.map((item, id) => {
                <div className="article">
                    <img className="article-img" src="https://img.redbull.com/images/c_crop,w_1607,h_803,x_0,y_92,f_auto,q_auto/c_scale,w_1200/redbullcom/2019/11/08/fc0f91de-3998-4be5-b50e-96d8d9e0cd45/lol-10-ans-league-of-legends"></img>
                    <h3 className="article-text">{id}</h3>
                </div>
            })}
            </div>
        </div>
    </>
    )
}
